161	\N	\N	2025-09-02 22:00:47.785396	1	https://www.odoo.com/documentation/master/applications/finance/fiscal_localizations.html	{"en_US": ""}	l10n_dk	Odoo House ApS, VK DATA ApS, FlexERP ApS	/account/static/description/l10n.png	uninstalled	\N	{"en_US": "Denmark - Accounting"}	38	{"en_US": "\\n\\nLocalization Module for Denmark\\n===============================\\n\\nThis is the module to manage the **accounting chart for Denmark**. Cover both one-man business as well as I/S, IVS, ApS and A/S\\n\\n**Modulet opstter:**\\n\\n- **Dansk kontoplan**\\n\\n- Dansk moms\\n        - 25% moms\\n        - Resturationsmoms 6,25%\\n        - Omvendt betalingspligt\\n\\n- Konteringsgrupper\\n        - EU (Virksomhed)\\n        - EU (Privat)\\n        - 3.lande\\n\\n- Finans raporter\\n        - Resulttopgrelse\\n        - Balance\\n        - Momsafregning\\n            - Afregning\\n            - Rubrik A, B og C\\n\\n- **Anglo-Saxon regnskabsmetode**\\n\\n.\\n\\nProdukt setup:\\n==============\\n\\n**Vare**\\n\\n**Salgsmoms:**      Salgmoms 25%\\n\\n**Salgskonto:**     1010 Salg af vare, m/moms\\n\\n**Kbsmoms:**       Kbsmoms 25%\\n\\n**Kbskonto:**      2010 Direkte omkostninger vare, m/moms\\n\\n.\\n\\n**Ydelse**\\n\\n**Salgsmoms:**      Salgmoms 25%, ydelser\\n\\n**Salgskonto:**     1011 Salg af ydelser, m/moms\\n\\n**Kbsmoms:**       Kbsmoms 25%, ydelser\\n\\n**Kbskonto:**      2011 Direkte omkostninger ydelser, m/moms\\n\\n.\\n\\n**Vare med omvendt betalingspligt**\\n\\n**Salgsmoms:**      Salg omvendt betalingspligt\\n\\n**Salgskonto:**     1012 Salg af vare, u/moms\\n\\n**Kbsmoms:**       Kb omvendt betalingspligt\\n\\n**Kbskonto:**      2012 Direkte omkostninger vare, u/moms\\n\\n\\n.\\n\\n**Restauration**\\n\\n**Kbsmoms:**       Restaurationsmoms 6,25%, kbsmoms\\n\\n**Kbskonto:**      4010 Restaurationsbesg\\n\\n.\\n\\n"}	f	f	f	LGPL-3	100	t	f	\N	\N	\N	\N				official	\N
163	\N	\N	2025-09-02 22:00:47.785396	1	https://www.odoo.com/documentation/master/applications/finance/fiscal_localizations.html	{"en_US": ""}	l10n_do	Gustavo Valverde - iterativo | Consultores de Odoo (http://iterativo.do)	/account/static/description/l10n.png	uninstalled	\N	{"en_US": "Dominican Republic - Accounting"}	38	{"en_US": "\\n\\nLocalization Module for Dominican Republic\\n===========================================\\n\\nCatlogo de Cuentas e Impuestos para Repblica Dominicana, Compatible para\\n**Internacionalizacin** con **NIIF** y alineado a las normas y regulaciones\\nde la Direccin General de Impuestos Internos (**DGII**).\\n\\n**Este mdulo consiste de:**\\n\\n- Catlogo de Cuentas Estndar (alineado a DGII y NIIF)\\n- Catlogo de Impuestos con la mayora de Impuestos Preconfigurados\\n        - ITBIS para compras y ventas\\n        - Retenciones de ITBIS\\n        - Retenciones de ISR\\n        - Grupos de Impuestos y Retenciones:\\n                - Telecomunicaiones\\n                - Proveedores de Materiales de Construccin\\n                - Personas Fsicas Proveedoras de Servicios\\n        - Otros impuestos\\n- Secuencias Preconfiguradas para manejo de todos los NCF\\n        - Facturas con Valor Fiscal (para Ventas)\\n        - Facturas para Consumidores Finales\\n        - Notas de Dbito y Crdito\\n        - Registro de Proveedores Informales\\n        - Registro de Ingreso nico\\n        - Registro de Gastos Menores\\n        - Gubernamentales\\n- Posiciones Fiscales para automatizacin de impuestos y retenciones\\n        - Cambios de Impuestos a Exenciones (Ej. Ventas al Estado)\\n        - Cambios de Impuestos a Retenciones (Ej. Compra Servicios al Exterior)\\n        - Entre otros\\n\\n**Nota:**\\nEsta localizacin, aunque posee las secuencias para NCF, las mismas no pueden\\nser utilizadas sin la instalacin de mdulos de terceros o desarrollo\\nadicional.\\n\\nEstructura de Codificacin del Catlogo de Cuentas:\\n===================================================\\n\\n**Un dgito** representa la categora/tipo de cuenta del del estado financiero.\\n**1** - Activo        **4** - Cuentas de Ingresos y Ganancias\\n**2** - Pasivo        **5** - Costos, Gastos y Prdidas\\n**3** - Capital       **6** - Cuentas Liquidadoras de Resultados\\n\\n**Dos dgitos** representan los rubros de agrupacin:\\n11- Activo Corriente\\n21- Pasivo Corriente\\n31- Capital Contable\\n\\n**Cuatro dgitos** se asignan a las cuentas de mayor: cuentas de primer orden\\n1101- Efectivo y Equivalentes de Efectivo\\n2101- Cuentas y Documentos por pagar\\n3101- Capital Social\\n\\n**Seis dgitos** se asignan a las sub-cuentas: cuentas de segundo orden\\n110101 - Caja\\n210101 - Proveedores locales\\n\\n**Ocho dgitos** son para las cuentas de tercer orden (las visualizadas\\nen Odoo):\\n1101- Efectivo y Equivalentes\\n110101- Caja\\n11010101 Caja General\\n"}	f	f	f	LGPL-3	100	t	f	\N	\N	\N	\N				official	\N
165	\N	\N	2025-09-02 22:00:47.785396	1	https://www.odoo.com/documentation/master/applications/finance/fiscal_localizations/ecuador.html	{"en_US": ""}	l10n_ec	TRESCLOUD (https://trescloud.com)	/account/static/description/l10n.png	uninstalled	\N	{"en_US": "Ecuadorian Accounting"}	38	{"en_US": "\\nFunctional\\n----------\\n\\nThis module adds accounting features for Ecuadorian localization, which\\nrepresent the minimum requirements to operate a business in Ecuador in compliance\\nwith local regulation bodies such as the ecuadorian tax authority -SRI- and the\\nSuperintendency of Companies -Super Intendencia de Compaas-\\n\\nFollow the next configuration steps:\\n1. Go to your company and configure your country as Ecuador\\n2. Install the invoicing or accounting module, everything will be handled automatically\\n\\nHighlights:\\n* Ecuadorian chart of accounts will be automatically installed, based on example provided by Super Intendencia de Compaas\\n* List of taxes (including withholds) will also be installed, you can switch off the ones your company doesn't use\\n* Fiscal position, document types, list of local banks, list of local states, etc, will also be installed\\n\\nTechnical\\n---------\\nMaster Data:\\n* Chart of Accounts, based on recomendation by Super Cas\\n* Ecuadorian Taxes, Tax Tags, and Tax Groups\\n* Ecuadorian Fiscal Positions\\n* Document types (there are about 41 purchase documents types in Ecuador)\\n* Identification types\\n* Ecuador banks\\n* Partners: Consumidor Final, SRI, IESS, and also basic VAT validation\\n"}	f	f	f	LGPL-3	100	t	f	TRESCLOUD	\N	\N	\N				official	\N
