249	\N	\N	2025-09-02 22:00:47.785396	1		{"en_US": "Checks Management"}	l10n_latam_check	ADHOC SA	/base/static/description/icon.png	uninstalled	\N	{"en_US": "Third Party and Deferred/Electronic Checks Management"}	37	{"en_US": "\\nOwn Checks Management\\n---------------------\\n\\nExtends 'Check Printing Base' module to manage own checks with more features:\\n\\n* allow using own checks that are not printed but filled manually by the user\\n* allow to use deferred or electronic checks\\n  * printing is disabled\\n  * check number is set manually by the user\\n* add an optional \\"Check Cash-In Date\\" for post-dated checks (deferred payments)\\n* add a menu to track own checks\\n\\nThird Party Checks Management\\n-----------------------------\\n\\nAdd new \\"Third party check Management\\" feature.\\n\\nThere are 2 main Payment Methods additions:\\n\\n* New Third Party Checks:\\n\\n  * Payments of this payment method represent the check you get from a customer when getting paid (from an invoice or a manual payment)\\n\\n* Existing Third Party check.\\n\\n  * Payments of this payment method are to track moves of the check, for eg:\\n\\n    * Use a check to pay a vendor\\n    * Deposit the check on the bank\\n    * Get the check back from the bank (rejection)\\n    * Get the check back from the vendor (a rejection or return)\\n    * Transfer the check from one third party check journal to the other (one shop to another)\\n\\n  * Those operations can be done with multiple checks at once\\n"}	f	f	f	LGPL-3	100	f	f	\N	\N	\N	\N				official	\N
250	\N	\N	2025-09-02 22:00:47.785396	1		{"en_US": "LATAM Document Types"}	l10n_latam_invoice_document	ADHOC SA	/base/static/description/icon.png	uninstalled	\N	{"en_US": "LATAM Document"}	37	{"en_US": "\\nFunctional\\n----------\\n\\nIn some Latinamerica countries, including Argentina and Chile, some accounting transactions like invoices and vendor bills are classified by a document types defined by the government fiscal authorities (In Argentina case AFIP, Chile case SII).\\n\\nThis module is intended to be extended by localizations in order to manage these document types and is an essential information that needs to be displayed in the printed reports and that needs to be easily identified, within the set of invoices as well of account moves.\\n\\nEach document type have their own rules and sequence number, this last one is integrated with the invoice number and journal sequence in order to be easy for the localization user. In order to support or not this document types a Journal has a new option that lets to use document or not.\\n\\nTechnical\\n---------\\n\\nIf your localization needs this logic will then need to add this module as dependency and in your localization module extend:\\n\\n* extend company's _localization_use_documents() method.\\n* create the data of the document types that exists for the specific country. The document type has a country field\\n\\n"}	f	f	f	LGPL-3	100	f	f	\N	\N	\N	\N				official	\N
