319	\N	\N	2025-09-02 22:00:47.785396	1	https://www.odoo.com/documentation/master/applications/finance/fiscal_localizations.html	{"en_US": ""}	l10n_uy	Uruguay l10n Team, Guillem Barba, ADHOC	/account/static/description/l10n.png	uninstalled	\N	{"en_US": "Uruguay - Accounting"}	38	{"en_US": "\\nGeneral Chart of Accounts.\\n==========================\\n\\nThis module adds accounting functionalities for the Uruguayan localization, representing the minimum required configuration for a company to operate in Uruguay under the regulations and guidelines provided by the DGI (Direccin General Impositiva).\\n\\nAmong the functionalities are:\\n\\n* Uruguayan Generic Chart of Account\\n* Pre-configured VAT Taxes and Tax Groups.\\n* Legal document types in Uruguay.\\n* Valid contact identification types in Uruguay.\\n* Configuration and activation of Uruguayan Currencies  (UYU, UYI - Unidad Indexada Uruguaya).\\n* Frequently used default contacts already configured: DGI, Consumidor Final Uruguayo.\\n\\nConfiguration\\n-------------\\n\\nDemo data for testing:\\n\\n* Uruguayan company named \\"UY Company\\" with the Uruguayan chart of accounts already installed, pre configured taxes, document types and identification types.\\n* Uruguayan contacts for testing:\\n\\n   * IEB Internacional\\n   * Consumidor Final Annimo Uruguayo.\\n\\n"}	f	f	f	LGPL-3	100	t	f	\N	\N	\N	\N				official	\N
